id: uuid:2745464d-62af-4e58-aae1-a7b9b72acb43
type: NewTextDefinition
new_value: The Rectus femoris muscle is one of the four quadriceps muscles of the
  human body. (The others are the vastus medialis, the vastus intermedius, and the
  vastus lateralis. All four combine to form the quadriceps tendon, which inserts
  into the patella and continues as the patellar ligament. ) The Rectus femoris is
  situated in the middle of the front of the thigh; it is fusiform in shape, and its
  superficial fibers are arranged in a bipenniform manner, the deep fibers running
  straight down to the deep aponeurosis. [WP,unvetted].
