new_value: The inferior labial artery (inferior labial branch of facial artery) arises
  near the angle of the mouth; it passes upward and forward beneath the Triangularis
  and, penetrating the Orbicularis oris, runs in a tortuous course along the edge
  of the lower lip between this muscle and the mucous membrane. It supplies the labial
  glands, the mucous membrane, and the muscles of the lower lip; and anastomoses with
  the artery of the opposite side, and with the mental branch of the inferior alveolar
  artery.
