id: uuid:5ff25b98-9bab-40e4-84cb-10b5e58523d3
type: NewTextDefinition
new_value: The anterior and posterior arteries created at the bifurcation of the popliteal
  artery. The anterior tibial artery begins at the lower border of the popliteus muscle
  and lies along the tibia at the distal part of the leg to surface superficially
  anterior to the ankle joint. Its branches are distributed throughout the leg, ankle,
  and pes. The posterior tibial artery begins at the lower border of the popliteus
  muscle, lies behind the tibia in the lower part of its course, and is found situated
  between the medial malleolus and the medial process of the calcaneal tuberosity.
  Its branches are distributed throughout the leg and foot.
about_node: UBERON:0007610

