id: uuid:d5f40b42-b592-444a-9c73-0488aa214e92
type: NewTextDefinition
new_value: The process of restoring DNA after damage. Genomes are subject to damage
  by chemical and physical agents in the environment (e.g. UV and ionizing radiations,
  chemical mutagens, fungal and bacterial toxins, etc.) and by free radicals or alkylating
  agents endogenously generated in metabolism. DNA is also damaged because of errors
  during its replication. A variety of different DNA repair pathways have been reported
  that include direct reversal, base excision repair, nucleotide excision repair,
  photoreactivation, bypass, double-strand break repair pathway, and mismatch repair
  pathway.
