type: NewTextDefinition
new_value: The hip region is located lateral to the gluteal region (i.e. the buttock),
  inferior to the iliac crest, and overlying the greater trochanter of the thigh bone.
  In adults, three of the bones of the pelvis have fused into the hip bone which forms
  part of the hip region. The hip joint, scientifically referred to as the acetabulofemoral
  joint (art. coxae), is the joint between the femur and acetabulum of the pelvis
  and its primary function is to support the weight of the body in both static (e.g.
  standing) and dynamic (e.g. walking or running) postures. [WP,modified].
