id: uuid:3e519125-59b2-4d87-818d-75673e77f03e
type: NewTextDefinition
new_value: The Styloglossus, the shortest and smallest of the three styloid muscles,
  arises from the anterior and lateral surfaces of the styloid process, near its apex,
  and from the stylomandibular ligament. Passing downward and forward between the
  internal and external carotid arteries, it divides upon the side of the tongue near
  its dorsal surface, blending with the fibers of the Longitudinalis inferior in front
  of the Hyoglossus; the other, oblique, overlaps the Hyoglossus and decussates with
  its fibers. [WP,unvetted].
