id: uuid:0bb7b593-6dee-41f4-ab7f-f5066f6aed64
type: NewTextDefinition
new_value: The entrance of the larynx is a triangular opening, narrow in front, wide
  behind, and sloping obliquely downward and backward. It is bounded, in front, by
  the epiglottis; behind, by the apices of the arytenoid cartilages, the corniculate
  cartilages, and the interarytenoid notch; and on either side, by a fold of mucous
  membrane, enclosing ligamentous and muscular fibers, stretched between the side
  of the epiglottis and the apex of the arytenoid cartilage; this is the aryepiglottic
  fold, on the posterior part of the margin of which the cuneiform cartilage forms
  a more or less distinct whitish prominence, the cuneiform tubercle. These folds
  form the upper borders of the quadrangular membrane.
about_node: UBERON:0014385

