id: uuid:ea62f951-655d-422a-89f3-13814b717709
type: NewTextDefinition
new_value: The head of the radius has a cylindrical form, and on its upper surface
  is a shallow cup or fovea for articulation with the capitulum (or capitellum) of
  the humerus. The circumference of the head is smooth; it is broad medially where
  it articulates with the radial notch of the ulna, narrow in the rest of its extent,
  which is embraced by the annular ligament. The deepest point in the fovea is not
  axi-symmetric with the long axis of the radius, creating a cam effect during pronation
  and supination[WP].
about_node: UBERON:0001012

