  \ fleshy fasciculus, narrower in the middle than at either end, forming, with the\
  \ mucous membrane covering its surface, the glossopalatine arch. It arises from\
  \ the anterior surface of the soft palate, where it is continuous with the muscle\
  \ of the opposite side, and passing downward, forward, and lateralward in front\
  \ of the palatine tonsil, is inserted into the side of the tongue, some of its fibers\
  \ spreading over the dorsum, and others passing deeply into the substance of the\
  \ organ to intermingle with the Transversus lingu\xE6. [WP,unvetted]."
