id: uuid:0e92638d-985c-496c-beb7-0d33f351eb21
type: NewTextDefinition
new_value: The olecranon is a large, thick, curved bony eminence of the forearm that
  projects behind the elbow. It is situated at the upper (proximal) end of the ulna,
  one of the two bones in the forearm. When the hand faces forward the olecranon faces
  towards the back (posteriorly). It is bent forward at the summit so as to present
  a prominent lip which is received into the olecranon fossa of the humerus in extension
  of the forearm. Its base is contracted where it joins the body and the narrowest
  part of the upper end of the ulna. Its posterior surface, directed backward, is
  triangular, smooth, subcutaneous, and covered by a bursa. Its superior surface is
  of quadrilateral form, marked behind by a rough impression for the insertion of
  the Triceps brachii; and in front, near the margin, by a slight transverse groove
  for the attachment of part of the posterior ligament of the elbow-joint. Its anterior
  surface is smooth, concave, and forms the upper part of the semilunar notch. Its
  borders present continuations of the groove on the margin of the superior surface;
  they serve for the attachment of ligaments, viz. , the back part of the ulnar collateral
  ligament medially, and the posterior ligament laterally. From the medial border
  a part of the Flexor carpi ulnaris arises; while to the lateral border the anconeus
  muscle is attached.
about_node: UBERON:0006810

