id: uuid:df23da6c-46a4-499b-b1ca-37b359e0fdca
type: NewTextDefinition
new_value: The enteric nervous system is composed of two ganglionated neural plexuses
  in the gut wall which form one of the three major divisions of the autonomic nervous
  system. The enteric nervous system innervates the gastrointestinal tract, the pancreas,
  and the gall bladder. It contains sensory neurons, interneurons, and motor neurons.
  Thus the circuitry can autonomously sense the tension and the chemical environment
  in the gut and regulate blood vessel tone, motility, secretions, and fluid transport.
  The system is itself governed by the central nervous system and receives both parasympathetic
  and sympathetic innervation[GO].
about_node: UBERON:0002005

