id: uuid:49fb3a39-5390-45b8-98e6-59b914fc492d
type: NewTextDefinition
new_value: 'The interphalangeal articulations of hand are hinge-joints of the phalanges
  of the hand. There are two sets (except in the thumb): ''proximal interphalangeal
  joints'' (PIP), those between the first (also called proximal) and second (intermediate)
  phalanges ''distal interphalangeal joints'' (DIP), those between the second and
  third (distal) phalanges A similar group of articulations also function in the toes.'
