id: uuid:6ae06fcd-b35b-4c2c-af79-8f5c69b1ae6d
type: NewTextDefinition
new_value: The incus or anvil is the anvil-shaped small bone or ossicle in the middle
  ear. It connects the malleus to the stapes. It was first described by Alessandro
  Achillin of Bologna. The incus transmits sound vibrations from the malleus to the
  stapes. The incus only exists in mammals, and is derived from a reptilian upper
  jaw bone, the quadrate bone. Embryologically it is derived from the first pharyngeal
  arch along with the rest of the bones of mastication, such as the maxilla and mandible.
  [WP,unvetted].
about_node: UBERON:0001688

