id: uuid:a851fd3b-220d-455c-9ea9-84b6dc977c12
type: NewTextDefinition
new_value: 'Anatomical structure that is a membranous gap between bones of the skull[TAO].
  In humans: Fontanelles are soft spots on a baby''s head which, during birth, enable
  the bony plates of the skull to flex, allowing the child''s head to pass through
  the birth canal. The ossification of the bones of the skull cause the fontanelles
  to close over by a child''s second birthday. The closures eventually form the sutures
  of the neurocranium. Although there are the two anterior and posterior fontanelles,
  there are two more fontanelles of interest, the mastoid fontanelle, and the sphenoidal
  fontanelle[WP].'
about_node: UBERON:0002221

