type: NewTextDefinition
new_value: 'The most posterior of the three principal regions of the brain. In mammals
  and birds the hindbrain is divided into a rostral metencephalon and a caudal myelencephalon.
  In zebrafish, with the exception of the cerebellum, the ventral remainder of the
  metencephalon can be separated only arbitrarily from the more caudal myelencephalic
  portion of the medulla oblongata (From: Neuroanatomy of the Zebrafish Brain)[ZFA].
  Organ component of neuraxis that has as its parts the pons, cerebellum and medulla
  oblongata[FMA].'
