id: uuid:62e294d3-c898-496e-aa00-04c4a2831281
type: NewTextDefinition
new_value: The lateral cricoarytenoid (also anterior cricoarytenoid) muscles extend
  from the lateral cricoid cartilage to the ipsilateral arytenoid cartilage. By rotating
  the arytenoid cartilages medially, these muscles adduct the vocal cords and thereby
  close the rima glottidis, protecting the airway. (Their action is antagonistic to
  that of the posterior cricoarytenoid muscles. ) The lateral cricoarytenoid muscles
  receive innervation from the recurrent laryngeal branch of the vagus nerve (CN X).
about_node: UBERON:0008573

