id: uuid:e75d091e-8045-4be7-94b1-3e74cf6dbe6d
type: NewTextDefinition
new_value: 'The nasalis (compressor naris) is a sphincter-like muscle of the nose
  whose function is to compress the nasal cartilage. It consists of two parts, transverse
  and alar: The transverse part arises from the maxilla, above and lateral to the
  incisive fossa; its fibers proceed upward and medially, expanding into a thin aponeurosis
  which is continuous on the bridge of the nose with that of the muscle of the opposite
  side, and with the aponeurosis of the Procerus. The alar part is attached at one
  end to the greater alar cartilage, and at the other to the integument at the point
  of the nose. Other sources divide it into ''Compressor nasalis'' and ''Dilator nasalis''.'
about_node: UBERON:0010953

