new_value: A process in which force is generated within voluntary skeletal muscle
  tissue, resulting in a change in muscle geometry. Force generation involves a chemo-mechanical
  energy conversion step that is carried out by the actin/myosin complex activity,
  which generates force through ATP hydrolysis. In the voluntary skeletal muscle,
  the muscle contraction takes advantage of an ordered sarcomeric structure and it
  is under voluntary control. Voluntary skeletal muscle is skeletal muscle that is
  under conscious control.
