id: uuid:fb8fdff6-fafb-4c0e-9d2a-00c58c1c1da5
type: NewTextDefinition
new_value: A pregnane-based steroidal hormone produced by the outer-section (zona
  glomerulosa) of the adrenal cortex in the adrenal gland, and acts on the distal
  tubules and collecting ducts of the kidney to cause the conservation of sodium,
  secretion of potassium, increased water retention, and increased blood pressure.
  The overall effect of aldosterone is to increase reabsorption of ions and water
  in the kidney.
