type: NewTextDefinition
new_value: The anterior facial vein (facial vein) commences at the side of the root
  of the nose, and is a direct continuation of the angular vein where it also receives
  a small nasal branch. It lies behind the facial artery and follows a less tortuous
  course. It receives blood from the external palatine vein before it either joins
  the anterior branch of the retromandibular vein to form the common facial vein,
  or drains directly into the internal jugular vein. [WP,unvetted].
