  subcortical masses of gray matter in the forebrain and midbrain that are richly
  interconnected and so viewed as a functional system. The nuclei usually included
  are the caudate nucleus (caudoputamen in rodents), putamen, globus pallidus, substantia
  nigra (pars compacta and pars reticulata) and the subthalamic nucleus. Some also
  include the nucleus accumbens and ventral pallidum[NIF,modified].
