id: uuid:bf9abce7-cf8a-4ca4-b7a0-15bfe1fd24e9
type: NewTextDefinition
new_value: The appearance of a chemokine due to biosynthesis or secretion following
  a cellular stimulus, resulting in an increase in its intracellular or extracellular
  levels. All chemokines possess a number of conserved cysteine residues involved
  in intramolecular disulfide bond formation. Some chemokines are considered pro-inflammatory
  and can be induced during an immune response to recruit cells of the immune system
  to a site of infection, while others are considered homeostatic and are involved
  in controlling the migration of cells during normal processes of tissue maintenance
  or development. Chemokines are found in all vertebrates, some viruses and some bacteria.
about_node: GO:0032602

