id: uuid:8e6e822d-4dcc-4b01-9658-d081b5eaa987
type: NewTextDefinition
new_value: The levator veli palatini is the elevator muscle of the velum palatinum
  in the human body. During swallowing, it contracts, elevating the soft palate to
  help prevent food from entering the nasopharynx. It is innervated via the pharyngeal
  plexus, primarily by the vagus nerve (CN X). The levator veli palatini (Levator
  palati) is a thick, rounded muscle situated lateral to the choanC&. It arises from
  the under surface of the apex of the petrous part of the temporal bone and from
  the medial lamina of the cartilage of the auditory tube. After passing above the
  upper concave margin of the Constrictor pharyngis superior it spreads out in the
  palatine velum, its fibers extending obliquely downward and medially to the middle
  line, where they blend with those of the opposite side.
about_node: UBERON:0008585

