id: uuid:b5bbf6f5-9573-4084-9af8-29917d1a0068
type: NewTextDefinition
new_value: A polypeptide hormone produced and secreted by the pituitary gland comprising
  39 amino acid residues coupled in a linear sequence. The N-terminal 24-amino acid
  segment is identical in all species and contains the adrenocorticotrophic activity.
  Corticotropin stimulates the cortex of the adrenal gland and boosts the synthesis
  of corticosteroids, mainly glucocorticoids but also sex steroids (androgens). It
  is used in the treatment of certain neurological disorders such as infantile spasms
  and multiple sclerosis, and diagnostically to investigate adrenocortical insufficiency.
about_node: CHEBI:3892

