id: uuid:15c0a485-7fb3-4e3c-b451-c7e8ee8784d1
type: NewTextDefinition
new_value: A muscle that originates in the upper two-thirds of the lateral surface
  of the tibia and inserts into the medial cuneiform and first metatarsal bones of
  the foot. Its acts to invert the foot. It is situated on the lateral side of the
  tibia; it is thick and fleshy above, tendinous below. This muscle overlaps the anterior
  tibial vessels and deep peroneal nerve in the upper part of the leg. [WP,unvetted].
  The M. tibialis cranialis is a muscle that flexes the tarsometatarsus. It originates
  on the craniodistal aspect of the femur and proximal tibiotarsus and inserts on
  the cranial surface of the tarsometarsus[EvoWiki].
about_node: UBERON:0001385

