id: uuid:2ff2167a-02df-490e-9a99-ed92843cfb57
type: NewTextDefinition
new_value: The malleus or hammer is a hammer-shaped small bone or ossicle of the middle
  ear which connects with the incus and is attached to the inner surface of the eardrum.
  The word is Latin for hammer. It transmits the sound vibrations from the eardrum
  to the incus. The malleus is unique to mammals, and evolved from a lower jaw bone
  in basal amniotes called the articular, which still forms part of the jaw joint
  in reptiles. Embryologically it is derived from the first pharyngeal arch along
  with the rest of the bones of mastication, such as the maxilla and mandible. [WP,unvetted].
about_node: UBERON:0001689

