id: uuid:8e96c680-be41-45ee-9eeb-8f3c0728c7f0
type: NewTextDefinition
new_value: Anatomical entity that comprises the organism in the early stages of growth
  and differentiation that are characterized by cleavage, the laying down of fundamental
  tissues, and the formation of primitive organs and organ systems. For example, for
  mammals, the process would begin with zygote formation and end with birth. For insects,
  the process would begin at zygote formation and end with larval hatching. For plant
  zygotic embryos, this would be from zygote formation to the end of seed dormancy.
  For plant vegetative embryos, this would be from the initial determination of the
  cell or group of cells to form an embryo until the point when the embryo becomes
  independent of the parent plant.
about_node: UBERON:0000922

