new_value: The Buccal fat pad is one of several encapsulated fat masses in the cheek.
  It is a deep fat pad located on either side of the face between the buccinator muscle
  and several more superficial muscles. It should not be confused with the malar fat
  pad, which is directly below the skin of the cheek. It should also not be confused
  with jowl fat pads. It is implicated in the formation of hollow cheeks and the nasolabial
  fold, but not in the formation of jowls.
