id: uuid:d8071cc8-92ec-42a8-a9be-59a0d752ddde
type: NewTextDefinition
new_value: The mastoid process is a conical prominence projecting from the undersurface
  of the mastoid portion of the temporal bone. It is located just behind the external
  acoustic meatus, and lateral to the styloid process. Its size and form vary somewhat;
  it is larger in the male than in the female. This process serves for the attachment
  of the posterior belly of the digastric, sternocleidomastoid, splenius capitis,
  and longissimus capitis muscles. The word is derived from the Greek 'masto-', alluding
  to its resemblance to the breast.
about_node: UBERON:0011220

