  to the central nervous system, which comprises the brain and spinal cord. The neural
  groove gradually deepens as the neural folds become elevated, and ultimately the
  folds meet and coalesce in the middle line and convert the groove into a closed
  tube, the neural tube or neural canal (which strictly speaking is the center of
  the neural tube), the ectodermal wall of which forms the rudiment of the nervous
  system. [WP,unvetted].
