id: uuid:990b9f01-a460-4636-a49d-a19d00701968
type: NewTextDefinition
new_value: A system consisting of renin, angiotensin-converting enzyme, and angiotensin
  II. Renin, an enzyme produced in the kidney, acts on angiotensinogen, an alpha-2
  globulin produced by the liver, forming angiotensin I. The converting enzyme contained
  in the lung acts on angiotensin I in the plasma converting it to angiotensin II,
  the most powerful directly pressor substance known. It causes contraction of the
  arteriolar smooth muscle and has other indirect actions mediated through the adrenal
  cortex.
about_node: UBERON:0018229

