id: uuid:e58fdff3-a233-4eae-8624-2e97f5a54938
type: NewTextDefinition
new_value: The part of the cerebral cortex that receives projections from the motor
  thalamus and which projects to motor neurons in the brainstem and spinal cord. The
  motor cortex corresponds to Brodmann's area 4 (MM). The primary motor cortex, or
  M1, is located on the precentral gyrus and on the anterior paracentral lobule on
  the medial surface of the brain. Of the three motor cortex areas, stimulation of
  the primary motor cortex requires the least amount of electrical current to elicit
  a movement. http://neuroscience.uth.tmc.edu/s3/chapter03.html.
about_node: UBERON:0001384

