id: uuid:88ed5bac-be1c-45c0-a8ab-c79ea61dc2ab
type: NewTextDefinition
new_value: The falx cerebri, also known as the cerebral falx, so named from its sickle-like
  form, is a strong, arched fold of dura mater which descends vertically in the longitudinal
  fissure between the cerebral hemispheres. It is narrow in front, where it is attached
  to the crista galli of the ethmoid; and broad behind, where it is connected with
  the upper surface of the tentorium cerebelli. Its upper margin is convex, and attached
  to the inner surface of the skull in the middle line, as far back as the internal
  occipital protuberance; it contains the superior sagittal sinus. Its lower margin
  is free and concave, and contains the inferior sagittal sinus. The falx cerebri
  is known to calcify with age.
about_node: UBERON:0006059

