  cell axons after which they have passed through the optic chiasm[ZFA]. Predominantly
  white matter structure found in diencephalon consisting of fibers originating in
  the retina. The optic tract is considered to extend from the point of the optic
  chiasm and terminates largely, although not exclusively, in the lateral geniculate
  complex. Other fibers end in the superior colliculus and other structures in the
  diencephalon, midbrain and brainstem (MM)[NIF].
