id: uuid:4a088d64-74ab-45ba-971a-e08d4ee8783e
type: NewTextDefinition
new_value: The optic disc or optic nerve head is the location where ganglion cell
  axons exit the eye to form the optic nerve. There are no light sensitive rods or
  cones to respond to a light stimulus at this point. This causes a break in the visual
  field called 'the blind spot' or the 'physiological blind spot'. The optic nerve
  head in a normal human eye carries from 1 to 1.2 million neurons from the eye towards
  the brain. [WP,unvetted].
about_node: UBERON:0001783

