id: uuid:3d74f025-ae01-4be3-b5e4-a541efa719b1
type: NewTextDefinition
new_value: The vestibular nerve is one of the two branches of the Vestibulocochlear
  nerve (the cochlear nerve being the other). It goes to the semicircular canals via
  the vestibular ganglion. It receives positional information. Axons of the vestibular
  nerve synapse in the vestibular nucleus on the lateral floor and wall of the fourth
  ventricle in the pons and medulla. It arises from bipolar cells in the vestibular
  ganglion, ganglion of Scarpa, which is situated in the upper part of the outer end
  of the internal auditory meatus. [WP,unvetted].
about_node: UBERON:0003723

