id: uuid:b2fd68d2-4528-413b-b456-7d257e6ac0e6
type: NewTextDefinition
new_value: The acetabulum is a concave surface of the pelvis. The head of the femur
  meets with the pelvis at the acetabulum, forming the hip joint. There are three
  bones of the os coxae (hip bone) that come together to form the acetabulum. Contributing
  a little more than two-fifths of the structure is the ischium, which provides lower
  and side boundaries to the acetabulum. The ilium forms the upper boundary, providing
  a little less than two-fifths of the structure of the acetabulum. The rest is formed
  by the pubis, near the midline. It is bounded by a prominent uneven rim, which is
  thick and strong above, and serves for the attachment of the acetabular labrum,
  which reduces its opening, and deepens the surface for formation of the hip joint.
  At the lower part of the acetabulum is the acetabular notch, which is continuous
  with a circular depression, the acetabular fossa, at the bottom of the cavity of
  the acetabulum. The rest of the acetabulum is formed by a curved, crescent-moon
  shaped surface, the lunate surface, where the joint is made with the head of the
  femur. Its counterpart in the pectoral girdle is the glenoid fossa.[WP,unvetted].
about_node: UBERON:0001269

