id: uuid:07150067-02b5-4a5b-a041-06188ed54b67
type: NewTextDefinition
new_value: The middle cerebral artery (MCA) is one of the three major paired arteries
  that supplies blood to the cerebrum. The MCA arises from the internal carotid and
  continues into the lateral sulcus where it then branches and projects to many parts
  of the lateral cerebral cortex. It also supplies blood to the anterior temporal
  lobes and the insular cortices. The left and right MCAs rise from trifurcations
  of the internal carotid arteries and thus are connected to the anterior cerebral
  arteries and the posterior communicating arteries, which connect to the posterior
  cerebral arteries. The MCAs are not considered a part of the Circle of Willis. [WP,unvetted].
about_node: UBERON:0001627

