new_value: In humans, the anterior fontanelle (bregmatic fontanelle, frontal fontanelle)
  is the largest, and is placed at the junction of the sagittal suture, coronal suture,
  and frontal suture; it is lozenge-shaped, and measures about 4 cm in its antero-posterior
  and 2.5 cm in its transverse diameter. The fontanelle allows the skull to deform
  during birth to ease its passage through the birth canal and for expansion of the
  brain after birth. While the posterior and lateral fontanelles are obliterated by
  about six months after birth, the anterior is not completely closed until about
  the middle of the second year. Full ossification starts in the late twenties and
  finishes before the age of 50 . [WP,unvetted].
about_node: UBERON:0002510

