id: uuid:ee39b034-75d4-4c96-8667-dd2799bdf4dd
type: NewTextDefinition
new_value: A long bone is a bone that has a shaft and 2 ends and is longer than it
  is wide. Long bones have a thick outside layer of compact bone and an inner medullary
  cavity containing bone marrow.  The ends of a long bone contain spongy bone and
  an epiphyseal plate or line depending on the stage of development. The epiphyseal
  plate is a hyaline cartilage, where new bone growth takes place, lengthening the
  bone prior to adulthood. Bone lengthening ceases when this cartilage is lost, leaving
  a remnant referred to as an epiphyseal line.
about_node: UBERON:0002495

