id: uuid:2ce180e7-35a4-4bc2-b1f6-b1f299c9bb83
type: NewTextDefinition
new_value: The basic functional unit of the kidney. its chief function is to regulate
  the concentration of water and soluble substances like sodium salts by filtering
  the blood, reabsorbing what is needed and excreting the rest as urine. A nephron
  eliminates wastes from the body, regulates blood volume and blood pressure, controls
  levels of electrolytes and metabolites, and regulates blood pH. Its functions are
  vital to life and are regulated by the endocrine system by hormones such as antidiuretic
  hormone, aldosterone, and parathyroid hormone.[WP].
about_node: UBERON:0001285

