type: NewTextDefinition
new_value: Part of the metencephalon that lies in the posterior cranial fossa behind
  the brain stem. It is concerned with the coordination of movement[MESH]. A large
  dorsally projecting part of the brain concerned especially with the coordination
  of muscles and the maintenance of bodily equilibrium, situated between the brain
  stem and the back of the cerebrum , and formed in humans of two lateral lobes and
  a median lobe[BTO]. Brain structure derived from the anterior hindbrain, and perhaps
  including posterior midbrain. The cerebellum plays a role in somatic motor function,
  the control of muscle tone, and balance[ZFA].
