id: uuid:0d3e1c36-30f7-4dd3-b8bf-84a8511fc6b9
type: NewTextDefinition
new_value: The body of ilium enters into the formation of the acetabulum, of which
  it forms rather less than two-fifths. Its external surface is partly articular,
  partly non-articular; the articular segment forms part of the lunate surface of
  the acetabulum, the non-articular portion contributes to the acetabular fossa. The
  internal surface of the body is part of the wall of the lesser pelvis and gives
  origin to some fibers of the Obturator internus. Below, it is continuous with the
  pelvic surfaces of the ischium and pubis, only a faint line indicating the place
  of union.
about_node: UBERON:0010747

