type: NewTextDefinition
new_value: 'Thick, fibrous meningeal covering surrounding the brain and spinal cord.
  It is the outermost of the three meningeal coverings. It consists of two layers:
  the periosteal dura linking the inner surface of the skull and the meningeal dura
  that lies above the arachnoid dural membrane. The meningeal layer draws away from
  the periosteal layer and certain locations to form the dural reflections.'
