id: uuid:70f018d0-5d09-49cb-819c-8faddab42d7d
type: NewTextDefinition
new_value: The part of the face above the eyes[MESH]. In human anatomy, the forehead
  is the fore part of the head. It is, formally, an area of the head bounded by three
  features, two of the skull and one of the scalp. The top of the forehead is marked
  by the hairline, the edge of the area where hair on the scalp grows. The bottom
  of the forehead is marked by the supraorbital ridge, the bone feature of the skull
  above the eyes. The two sides of the forehead are marked by the temporal ridge,
  a bone feature that links the supraorbital ridge to the coronal suture line and
  beyond[WP].
about_node: UBERON:0008200

