  of the eye and slightly below the level of the optic disk. It is characterized by
  the presence of a yellow pigment diffusely permeating the inner layers, contains
  the fovea centralis in its center, and provides the best phototopic visual acuity.
  It is devoid of retinal blood vessels, except in its periphery, and receives nourishment
  from the choriocapillaris of the choroid. (From Cline et al., Dictionary of Visual
  Science, 4th ed).
