id: uuid:db7b0b4c-26fc-4815-a8d9-0a914dc5b733
type: NewTextDefinition
new_value: A dielectric (electrically insulating) material consisting of protein and
  fat that forms a layer, the myelin sheath, usually around only the axon of a neuron.
  Myelin is about 40 % water; the dry mass of myelin is about 70 - 85 % lipids and
  about 15 - 30 % proteins. Some of the proteins that make up myelin are myelin basic
  protein (MBP), myelin oligodendrocyte glycoprotein (MOG), and proteolipid protein
  (PLP). The primary lipid of myelin is a glycolipid called galactocerebroside (GalC).
  The intertwining hydrocarbon chains of sphingomyelin serve to strengthen the myelin
  sheath.
about_node: UBERON:0000345

